description:
The CIA connection to the bombers of the World Trade Center in 1993----how all of them, except the the FBI informant planted in the group, had been on the CIA payroll in Afghanistan fighting the Soviets before they settled in the New York area.

Doctor: &quot;You have to be a cog in the system to get along...&quot;

Murk: &quot;I've always thought of myself as a wrench...&quot;

